**Objek #:** SCP-2165

**Kelas Objek:** Tidak ada

**Prosedur Penanganan Khusus:** SCP-2165 harus selalu disimpan pada perangkatnya sendiri. informasi mengenai SCP-2165 tidak boleh diketahui di luar referensi ini. Referensi ini harus disimpan di lokasi ekstra-temporal dan ekstra-spasial. Semuanya seperti dulu. Semuanya seperti biasanya.

**Deskripsi:** SCP-2165 tidak dapat diubah. Tidak dapat diketahui apakah SCP-2165 adalah entitas sapien, makhluk non-sapien, benda mati, atau konsep metafisik. Hal ini dianggap tidak relevan oleh para personel penahanan. SCP-2165 telah melakukan suatu tindakan atau menyebabkan serangkaian tindakan yang dianggap tidak dapat dimaafkan oleh konsensus universal. Sifat dasar yang spesifik dari tindakan ini atau berbagai tindakan tersebut telah dihapus dari kausalitas oleh konsensus universal. Dengan demikian, baik SCP-2165 maupun informasi apa pun tentangnya tidak pernah diketahui oleh makhluk, objek, kekuatan, atau konsep lainnya.

**Lampiran:** Tidak akan ada pengampunan.
